import React from "react";
import './Helper.css';
import { Col, Container } from "react-bootstrap";


function Helper(){
    <Container>
        <Col md = "6" sm = "12"> 
        <img src = "" />
        </Col>

        <Col md = "6" sm = "12">
            <h1>Air Jordan 1 Retro High OG</h1>
            <h4 class = "text-muted">Women's Shoes</h4>
        </Col>
    </Container>
}


export default Helper
